  LarryH1,
  LarryH2,
  LarryP,
} from "./LarryElements";

const Article_Larry = () => {
  return (
    <LarryContainer id="larry">
      <motion.div
        animate={{
          x: 0,
          opacity: 1,
        }}
        initial={{
          x: 700,
          opacity: 0,
        }}
        exit={{
          x: -700,
          opacity: 0,
        }}
        transition={{
          duration: 0.5,
        }}
      >
        <LarryWrapper>
        <Icon to="/">Yuya</Icon>


          <LarryP>
            dummy Text dummy Text dummy Text dummy Text dummy Text dummy Text
            dummy Text dummy Text
          </LarryP>
        </LarryWrapper>
      </motion.div>

    </LarryContainer>
  );
};

export default Article_Larry;
